import React from "react";

const AutoUploadImage = (props) => {
    const {image} = props;
  return (
    <div>
      <img
        className="img- img-thumbnail"
        src={image}
        alt="post-attachment"
      />
    </div>
  );
};

export default AutoUploadImage;
